System.register([],(function(e){return{execute:function(){e({_template_label_introduction:"Einleitung",_template_description_introduction:'"Einleitung" ist eine Vorlage mit einem modularen Layout, in der Sie Ihre Bilder und markante Überschriften darstellen können.',_template_label_timeline:"Zeitachse",_template_description_timeline:'"Zeitachse" ist eine Vorlage, in der die Bilder und Inhalte in chronologischer Reihenfolge dargestellt werden.',_template_label_general:"Allgemein",_template_description_general:'"Allgemein" bietet eine lange Vorlage zum Scrollen, mit der Sie die Geschichten hinter Ihren Inhalten weitergeben können.',_template_label_snapshot:"Snapshot",_template_description_snapshot:'"Snapshot" ist eine Vorlage, mit der Sie die verwendeten Bilder mithilfe von Abschnitten, Ansichtsnavigation und Kacheln präsentieren können.',_template_label_blankscrollable:"Leere Bildlaufseite",_template_description_blankscrollable:"Eine leere Vorlage zum Erstellen eines eigenen Designs in einer Bildlaufseite.",_template_label_dash:"Strich",_template_description_dash:'"Strich" ist eine Vorlage zum Anzeigen wichtiger Kennwerte mit Diagrammen, Karten, Kacheln und Text-Widgets.',_template_label_parallax:"Parallaxe",_template_description_parallax:'Mit "Parallaxe" können Sie der Experience ein Hero-Image-Layout hinzufügen.',_template_label_epic:"Epic",_template_description_epic:'"Epic" bietet eine lange Vorlage zum Scrollen, mit der Sie eine Website erstellen können.',_template_label_reveal:"Entdecken",_template_description_reveal:'Mit "Entdecken" können Sie eine Story-Tour zu wichtigen Datenpunkten unter Verwendung von Tabellen, Diagrammen und Lesezeichen erstellen.',_template_label_gallery:"Galerie",_template_description_gallery:'"Galerie" ist eine Vorlage mit markanten Miniaturansicht-Bildern, anhand derer Sie Ihre informativen Inhalte hervorheben.',_template_label_summary:"Zusammenfassung",_template_description_summary:'"Zusammenfassung" ist eine Vorlage für eine sekundäre oder Schlussseite, bei der der Schwerpunkt auf kurzen Textbeschreibungen und weiterführenden Links zu zusätzlichen Inhalten liegt.',_template_label_foldable:"Foldable",_template_description_foldable:'"Foldable" ist eine Vorlage mit einer einfachen, offenen Oberfläche, deren Schwerpunkt die Karte ist. Sie enthält eine Kopfzeile und ein Controller-Widget.',_template_label_launchpad:"Launchpad",_template_description_launchpad:'"Launchpad" ist eine Vorlage, bei der der Schwerpunkt auf der Karte und einem Controller-Widget liegt, das unten auf der Seite verankert ist.',_template_label_dart:"Dart",_template_description_dart:'"Dart" ist eine kartenfokussierte Vorlage. Die Widgets sind in einem fixierten Fenster am unteren Rand der Karte platziert.',_template_label_jewelrybox:"JewelryBox",_template_description_jewelrybox:'"JewelryBox" ist eine Vorlage, mit der Features in einer Liste kombiniert mit einer Karte angezeigt werden können.',_template_label_blankfullscreen:"Leeres Vollbild",_template_description_blankfullscreen:"Eine leere Vorlage zum Erstellen eines eigenen Designs in einer Vollbild-App.",_template_label_quicknavigation:"Schnellnavigation",_template_description_quicknavigation:"Mit der Schnellnavigation können Sie auf einer Seite schnell zwischen verschiedenen Ansichten und Lesezeichen wechseln.",_template_label_pocket:"Pocket",_template_description_pocket:'"Pocket" ist eine Vorlage mit einer Karte und einem halbtransparenten Widget des Typs "Platzhalter". Sie eignet sich für die Erstellung von Apps, die ein Haupt-Widget enthalten, das mit der Karte interagiert.',_template_label_journey:"Journey",_template_description_journey:'"Journey" ist eine Vorlage, in der mit dem Widget "Lesezeichen" und einer Karte eine interaktive Tour erstellt werden kann.',_template_label_ribbon:"Menüband",_template_description_ribbon:'"Menüband" ist eine Vorlage, bei der der Schwerpunkt auf dem Lesezeichen liegt, um die Navigation in der Karte zu steuern.',_template_label_billboard:"Billboard",_template_description_billboard:'"Billboard" wurde unter dem Aspekt der Einfachheit erstellt und enthält eine Karte und ein Controller-Widget.',_template_label_monitor:"Monitor",_template_description_monitor:'"Monitor" ist eine einseitige Vorlage, die eine Kombination von Widgets zum Organisieren, Tracken und Anzeigen Ihrer Datenvisualisierungen in einem Dashboard-Layout enthält.',_template_label_header1:"Überschrift 1",_template_label_header2:"Überschrift 2",_template_label_header3:"Überschrift 3",_template_label_header4:"Überschrift 4",_template_label_footer1:"Fußzeile 1",_template_label_footer2:"Fußzeile 2",_template_label_footer3:"Fußzeile 3",_template_label_footer4:"Fußzeile 4",_template_label_scenic:"Scenic",_template_description_scenic:'Mit "Scenic" können Sie eine Tour in Form einer Erzählung erstellen, indem Sie das Widget "Lesezeichen" mit dem mehrseitigen Layout verwenden.',_template_label_exhibition:"Exhibition",_template_description_exhibition:'"Exhibition" hält ein mehrseitiges Layout für die Erstellung einer Website bereit, in dem anhand von Kacheln, Listen und Karten-Widgets Bilder und Inhalte hervorgehoben werden.',_template_label_indicator:"Indikator",_template_description_indicator:'"Indikator" hält ein mehrseitiges Layout mit einer einzigartigen Samlung von Widgets für die Erstellung eines modernen Dashboards bereit.',_template_label_block1:"Block 1",_template_label_block2:"Block 2",_template_label_block3:"Block 3",_template_label_block4:"Block 4",_template_label_block5:"Block 5",_template_label_block6:"Block 6",_template_label_grid1:"Raster 1",_template_label_grid2:"Raster 2",_template_label_grid3:"Raster 3",_template_label_grid4:"Raster 4",_template_label_blankwindow:"Leeres Fenster",_template_label_confirm:"Bestätigen",_template_label_alert:"Warnung",_template_label_simple:"Einfach",_template_label_vogue:"Vogue",_template_label_novel:"Novel",_template_label_sidebar:"Seitenleiste",_template_label_tooltip:"Quickinfo",_template_label_blank:"Leerer Bildschirm",_template_label_centralfloating:"Unverankert zentriert",_template_label_leftfloating:"Unverankert links",_template_label_rightfloating:"Unverankert rechts",_template_label_rightdock:"Verankert rechts",_template_label_leftdock:"Verankert links",_template_label_stream:"Stream",_template_label_guide:"Anleitung",_template_label_slideshow:"Bildschirmpräsentation",_template_label_cascade:"Cascade",_template_label_showcase:"Highlight",_template_label_portfolio:"Portfolio",_template_label_flyer:"Flyer",_template_label_vacation:"Reise",_template_description_vacation:'Mit der Vorlage "Reise" kann mit dem Widget "Flug-Controller" und Karten eine interaktive Website für ein Reise-Event erstellt werden.',_template_label_voyage:"Voyage",_template_description_voyage:'"Voyage" ist eine Vorlage mit interaktiven geplanten Routen des Widgets "Flug-Controller" und 3D-Kartendaten in Verbindung mit Text- und Bild-Illustrationen sowie Schaltflächen-Widgets für Tour-Attraktionen.',_template_label_carousel:"Karussell",_template_label_particulars:"Particulars",_template_label_nopanel:"Kein Fenster",_template_label_dashboard:"Dashboard",_template_description_dashboard:'"Dashboard" ist eine Vorlage mit einer Karte in der oberen rechten Ecke, die von fünf anpassbaren Platzhaltern umgeben ist. Diese ermöglichen das einfache Gestalten von Inhalten.',_template_label_seeker:"Seeker",_template_description_seeker:'"Seeker" ist eine Vorlage, die als Web-Homepage konzipiert wurde. Sie können das Widget "Suche" oben auf der Seite verwenden, um schnell die gewünschten Informationen zu erhalten.',_template_label_booking:"Booking",_template_description_booking:'Die Vorlage "Booking" stellt ein mehrseitiges Layout mit den Widgets "Suche" und "Filtern" zum Sichten von Daten zur Verfügung. Die Suchergebnisse werden auf einer separaten Seite mit einem Detailfenster angezeigt, das weitere Informationen enthält.',_template_label_events:"Ereignisse",_template_description_events:'"Ereignisse" ist eine Bildlaufvorlage, die mithilfe von Kachel-Widgets und der Hover-Funktion einen Zoom-Hover-Effekt erzeugt.',_template_label_forecast:"Prognose",_template_description_forecast:'"Prognose" verwendet Kachel-, Karten- und Diagramm-Widgets, um einige der wichtigen Informationen in dem Bericht zusammen mit dem Zeichen-Widget zu repräsentieren, um Endbenutzern das Hervorheben einiger interessanter Bereiche auf der Karte zu ermöglichen.',_template_label_gear:"Zahnrad",_template_description_gear:'"Zahnrad" ist eine Vorlage, die das Widget "Abschnitt" enthält, für das die automatische Wiedergabe von vier identisch strukturierten Ansichten festgelegt ist, um verschiedene Inhalte einer bestimmten Kategorie zur veranschaulichen.',_template_description_showcase:'"Showcase" ist eine Vorlage mit vier gleich großen Kachel-Widgets, in denen mehr Details angezeigt werden, wenn Sie mit der Maus darauf zeigen.',_template_label_route:"Route",_template_description_route:'"Route" ist eine Vorlage, in der mit den Widgets "Diagramm", "Liste" und "Lesezeichen" verschiedene Orte präsentiert werden können. Es umfasst zudem das Widget "Wegbeschreibung", damit Benutzer Fahrten zu den präsentierten Orten visualisieren können.',_template_label_steps:"Schritte",_template_label_sketchbook:"Skizzenbuch",_template_description_sketchbook:'"Skizzenbuch" ist eine Vorlage, in der mit den Widgets "Kachel", "Karte" und "Diagramm" Daten präsentiert werden können. Es umfasst zudem das Widget "Zeichnen", um Interessenbereiche auf der Karte zu markieren.',_template_label_blankfullscreenGrid:"Leeres Raster",_template_description_blankfullscreenGrid:"Eine leere Vorlage zum Erstellen eines eigenen Designs auf einer Raster-Seite.",_template_label_blankfullscreengrid:"Leeres Raster",_template_description_blankfullscreengrid:"Eine leere Vorlage zum Erstellen eines eigenen Designs auf einer Raster-Seite.",_template_label_showplace:"Showplace",_template_description_showplace:'"Showplace" ist eine Vorlage mit vier gleich großen Kachel-Widgets, in denen mehr Details angezeigt werden, wenn Sie mit der Maus darauf zeigen.',_template_label_kit:"Kit",_template_description_kit:'In der Vorlage "Kit" werden die Widgets "3D-Toolbox", "Lesezeichen" und "Karte" zum Anzeigen von 3D-Effekten für Webszenen verwendet.',_template_label_chronology:"Chronology",_template_description_chronology:'In der Vorlage "Chronology" werden Zeitdatenmuster mit den Widgets "Zeitachse" und "Karte" visualisiert, und das Widget "Drucken" wird zum Drucken verwendet. Neben der Karte werden in verschiedenen Diagrammen statistische Informationen zu den wechselnden Zeiträumen angezeigt.',_template_label_checkerboard:"Checkerboard",_template_description_checkerboard:'"Checkerboard" ist eine Raster-Seitenvorlage mit einem Karten-Widget in der Mitte und kartenbezogenen Widgets um dieses herum.',_template_label_illustrator:"Illustrator",_template_description_illustrator:'Mit "Illustrator" können Sie einen Ort in einem mehrseitigen Layout mit den Widgets "Bild", "Zeitachse" und "Karte" vollständig beschreiben.',_template_label_showroom:"Showroom",_template_description_showroom:'"Showroom" ist eine Vorlage mit vier gleich großen Kachel-Widgets, in denen mehr Details angezeigt werden, wenn Sie mit der Maus darauf zeigen.',_template_label_collage:"Collage",_template_description_collage:'"Collage" ist eine Raster-Seitenvorlage, in der mehrere Bild-Widgets um das Widget "Fixiertes Fenster" angezeigt werden.',_template_label_pamphlet:"Broschüre",_template_description_pamphlet:'"Broschüre" ist eine Vorlage mit einer einzelnen Vollbildseite, bei der die Karte im Mittelpunkt steht. Durch den Seitenbereich und die Abschnittsansichten fungiert das Widget "Kachel" als Navigationselement und erzeugt dadurch den Eindruck, durch eine Broschüre zu blättern.',_template_label_avatarboard:"Avatarboard",_template_description_avatarboard:'"Avatarboard" ist eine Raster-Seitenvorlage, in der mehrere Kachel-Widgets mit Hover- und Umdrehfunktion angezeigt werden. Wie bei einer Karteikarte können Sie weitere Details auf der Rückseite einer Kachel hinzufügen.',_template_label_mapflyer:"Kartenflyer",_template_description_mapflyer:'"Kartenflyer" ist eine Raster-Seitenvorlage, in der über die Widgets "Koordinaten" und "Karte" Text und Positionsinformationen aus einer Karte angezeigt werden.',_template_label_leaflet:"Faltblatt",_template_description_leaflet:'"Faltblatt" ist eine Raster-Seitenvorlage mit Text- und Bild-Widgets, die in mehreren Spalten-Widgets angeordnet sind, um ein vertikales Layout zu erzeugen.',_template_label_index:"Index",_template_label_frame:"Rahmen",_template_description_frame:'"Rahmen" ist eine Vorlage mit Rahmendesign, durch das ein Gefühl von Ordnung und Struktur verliehen wird. Durch die Einbettung von Bildern und Text in Rahmen vermittelt die Vorlage einen geordneten und übersichtlichen Eindruck der Inhalte.',_template_label_multiverse:"Multiversum",_template_description_multiverse:'"Multiversum" ist eine Vorlage, die für die Arbeit mit mehreren Datenquellen konzipiert ist. Durch das Widget "Daten hinzufügen" wird der Import von Daten aus verschiedenen Quellen vereinfacht. Dies erleichtert es wiederum den Anwendern, verschiedene Datenquellen mittels Karten und Tabellen zu vergleichen und zu analysieren.',_template_label_elevate:"Elevate",_template_description_elevate:'"Elevate" ist eine mehrseitige Vorlage, die für die optimierte Inhaltsdarstellung mit höchster Benutzerfreundlichkeit konzipiert wurde. Durch das schlichte Design und die übersichtliche Struktur eignet sich die Vorlage hervorragend für das Storytelling.',_template_label_comparatist:"Comparatist",_template_description_comparatist:'"Comparatist" ist eine Vorlage mit einem interaktiven Widget "Vergleichen", mit dem Karten-Layer zum Vergleichen nebeneinander angezeigt werden können. Die Widgets "Diagramm" und "Feature-Info" bieten ebenfalls eine ausführlichere Beschreibung der zugrunde liegenden Daten.',_template_label_panorama:"Panorama",_template_description_panorama:'"Panorama" bietet eine zentrale Karte umgeben von zwei Diagramm-Widgets in einem Gitter-Layout. Benutzer können mit den Widgets "Diagramm", "Liste" und "Filtern" interagieren, um auf der Karte dargestellte Daten aus unterschiedlichen Blickwinkeln zu interpretieren.',_template_label_lens:"Linse",_template_description_lens:'"Linse" ist eine zweiseitige Vorlage für die multidimensionale Datenerkundung. Auf der Startseite werden Informationen durch Karten, Diagramme und Filter in einen Kontext gesetzt. Mit Lesezeichen auf der zweiten Seite können Benutzer bestimmte Teilmengen von Daten untersuchen.',_template_label_datacollector:"Data collector",_template_description_datacollector:'"Data collector" ist eine Vorlage, die das Widget "Bearbeiten" mit einer Karte enthält und die Möglichkeit bietet, Features hinzuzufügen, zu löschen und zu bearbeiten. Zusammen mit Diagrammen, Texten und Listen im linken Fenster werden wichtige Kennwerte Ihrer Live-Daten angezeigt.',_template_label_tessellate:"Tessellate",_template_description_tessellate:'"Tesselate" ist eine Dashboard-ähnliche, scrollfähige Seitenvorlage, die Text, Diagramme, eine Tabelle und weitere Widgets zur Anzeige von Informationen aus einer Datenquelle enthält.',_template_label_plateau:"Plateau",_template_description_plateau:'"Plateau" ist eine einfache, moderne App-Vorlage mit einer reduzierten Werkzeugleiste und einem Widget-Container oben auf der Seite.',_template_label_preface:"Preface",_template_description_preface:'"Preface" ist eine Vollbildvorlage mit mehreren Hintergrundfarben. Sie zeigt grundlegende Informationen in kompakten Blöcken und eignet sich für Einführungen.',_template_label_sleuth:"Sleuth",_template_description_sleuth:'"Sleuth" bietet ein Navigationsmenü auf der linken Seite. Verwenden Sie die Pfeiltasten, um zwischen den Inhalten zu wechseln. Klicken Sie auf das gewünschte Element, um die zugehörigen Details im Fenster unten rechts anzuzeigen.',_template_label_footnote:"Fußnote",_template_label_iteminfo:"Element-Info",_template_label_lrsviewer:"LRS-Viewer",_template_description_lrsviewer:'Der LRS-Viewer ist eine Vorlage für die Abfrage und Suche von LRS-Daten, die die Widgets "Suche nach Route", "LRS-Identifizierung" sowie weitere Widgets enthält. Die Vorlage kann mit Daten aus ArcGIS Roads and Highways und ArcGIS Pipeline Referencing verwendet werden.',_template_label_lrseditor:"LRS-Editor",_template_description_lrseditor:'Der LRS-Editor ist eine Vorlage für die Abfrage und Suche von LRS-Daten, die die Widgets "Punktobjekt hinzufügen", "Linienobjekt hinzufügen". "Objekt teilen", "Objekte zusammenführen" sowie weitere Widgets enthält. Die Vorlage kann mit Daten aus ArcGIS Roads and Highways und ArcGIS Pipeline Referencing verwendet werden.',_template_label_lrs_event_editor:"LRS-Objekteditor",_template_description_lrs_event_editor:'Der LRS-Objekteditor ist eine Vorlage für die Abfrage und Suche von LRS-Daten, die die Widgets "Punktobjekt hinzufügen", "Linienobjekt hinzufügen", "Objekt teilen", "Objekte zusammenführen" sowie weitere Widgets enthält. Die Vorlage kann mit Daten aus ArcGIS Roads and Highways und ArcGIS Pipeline Referencing verwendet werden.',_template_label_tab:"Registerkarte",_template_description_tab:'Die Vorlage "Registerkarte" ist eine kartenbasierte Vorlage mit Registerkarten auf der linken Seite, die zum Öffnen verschiedener Inhalte auf der Seitenleiste dienen.',_template_label_scrutiny:"Überprüfung",_template_description_scrutiny:'Die Vorlage "Überprüfung" verfügt über ein breites Banner am oberen Rand der Seite und ähnlich strukturierten Modulen mit Scroll-Funktion darunter.',_template_label_assessor:"Gutachter",_template_description_assessor:'Die Vorlage "Gutachter" bietet mit drei Spotlight-Kacheln, einer zugeordneten Referenz und unterstützenden Tabellendaten einen komprimierten Überblick.',_template_label_contour:"Konturlinie",_template_description_contour:'Die Vorlage "Konturlinie" ermöglicht eine umfassende Inspektion mithilfe einer herausragenden Kartenansicht, die durch Diagramme und kontextbezogenen Text ergänzt wird.',_template_label_logbook:"Logbuch",_template_description_logbook:'Die Vorlage "Logbuch" ist eine mehrseitige Vorlage, die eine vielfältige Datenuntersuchung ermöglicht, indem sie auf der Startseite wichtige Statistiken aufzeichnet und diese Daten mithilfe von Karten, Bildern, Diagrammen und Tabellen auf anderen Seiten mit Scroll-Funktion genauer untersucht.',_template_label_recap:"Recap",_template_description_recap:"Recap bietet ein aufgeräumtes und klares Design, bei dem der Schwerpunkt auf dem Inhalt liegt. Bilder und Text sind in Blöcken organisiert und durch Leerraum getrennt, um eine klare thematische Unterteilung zu erreichen.",_template_label_skyline:"Skyline",_template_description_skyline:"Skyline ist eine elegante Vorlage zur professionellen Präsentation von Services. Sie bietet verschiedene Abschnitte mit kreisförmigen Bilddaten, eine prominente Kartenanzeige und ein galerieartiges Lesezeichen.",_template_label_edifice:"Edifice",_template_description_edifice:"Edifice ist eine professionelle Vorlage für architektonische Visualisierungen und Gebäudemanagement.",_template_label_vista:"Vista",_template_description_vista:"Vista ist eine umfassende zweiseitige Vorlage für die eingehende Erkundung von Gebäuden."})}}}));